func (p Painter) Text(label string, x, y int, size float64) {
	c := freetype.NewContext()

	paintFont, _ := truetype.Parse(aaargh)

	c.SetDPI(72)
	c.SetFont(paintFont)
	c.SetFontSize(size)
	c.SetClip(p.Bounds())
	c.SetDst(p)
	c.SetSrc(image.NewUniform(p.style.color))

	pt := freetype.Pt(x, y)
	c.DrawString(label, pt)
}

func (p Painter) TextWithFont(label string, x, y int, size float64, font []byte) error {
	c := freetype.NewContext()

	paintFont, err := truetype.Parse(font)
	if err != nil {
		return err
	}

	c.SetDPI(72)
	c.SetFont(paintFont)
	c.SetFontSize(size)
	c.SetClip(p.Bounds())
	c.SetDst(p)
	c.SetSrc(image.NewUniform(p.style.color))

	pt := freetype.Pt(x, y)
	c.DrawString(label, pt)

	return nil
}

